import React from 'react'

const BotList = ({names, setNames}) => {
  return (
    <div>
      {names.map((name) => (
        <li className='list' key={name.id}>
            <p>
                type="text"
                value={name.title}
                className='list-item'
                onChange={(event) => event.preventDefault()}
            </p>
        </li>
        )
      )}
    </div>
  )
}


export default BotList
